INSERT INTO `actives` VALUES ('26', '硕彦讲坛:教育部长江学者冯世进教授来我校讲学', '吕兵兵', '2017-03-10', '2016年6月22日，应我校土木与建筑工程学院邀请，教育部长江学者、同济大学博士生导师冯世进教授来我校讲学。报告会由建工学院院长罗战友教授主持，学院副院长程泽海教授、土木工程系部分老师、土木工程专业全体研究生和部分本科生参加了此次学术报告。', './Public/Uploads/2017-03-04/58baa933bcf3c.jpg', null, '2017-02-24 19:49:20', '2017-02-25 19:49:23', '大学生活动中心', '900', '2017-02-23 19:49:38', '2017-05-24 19:49:42', '888', '     ');
INSERT INTO `actives` VALUES ('27', '明理讲堂:了解情绪，管理情绪，快乐从“心”开始', '吕兵兵', '2017-03-10', '龚惠香给师生们带来了几个小游戏——心有千千结、情绪红绿灯，借此阐述情绪和心理的联系。通过此次讲座，同学们纷纷表示，要学会做自己情绪管理的主人，快乐从“心”开始，愉快的度过大学生活。', './Public/Uploads/2017-03-04/58baa98348630.png', null, '2017-03-04 19:50:38', '2017-03-04 19:50:41', '大学生活动中心', '200', '2017-03-03 19:51:00', '2017-05-19 19:51:04', '', '');
INSERT INTO `actives` VALUES ('28', '博雅论坛:中国人民大学中文系博士姜文振来我校讲学', '吕兵兵', '2017-03-16', '你是否曾和孔孟对话，与李杜共语；和书本拥抱，与大师交流\r\n你是否正穿梭在大千世界中感受美，发现美，创造美\r\n你是否也想有人同你从诗词歌赋谈到人生哲学\r\n博雅论坛邀你一起——与经典同行，绘人生底色；与博览共游，拓视野广阔。', './Public/Uploads/2017-03-04/58baa9e01204b.jpg', null, '2017-03-04 19:52:19', '2017-03-04 19:52:20', '大学生活动中心', '200', '2017-03-20 19:52:27', '2017-05-04 19:52:28', '冯天祥', '    ');
INSERT INTO `actives` VALUES ('40', '植树节活动”扮靓”校园', '吕兵兵', '2017-03-14', '3月10日上午，植树节前夕，学校举行植树活动，为校园增添新的生机。\r\n\r\n上午9时许，校党委书记龚建立、校长叶高翔等校领导带领中层干部、师生代表、校友代表来到校友林，众人扶树、填土、培实、浇水，分工明确，各个环节衔接有序，配合默契。在师生们的共同努力下，一株株冠幅丰满、枝干挺拔银杏树迎风挺立，为美丽校园增添了一片新绿。\r\n\r\n为确保植树活动顺利开展，资产处年初就牵头制定植树方案，后勤服务部利用寒假赴山东、江苏等地园林基地精心挑选树种，绿化中心员工在植树前挖坑、铺土做好准备工作。', './Public/Uploads/2017-03-14/58c809a72dc0e.jpg', null, '2017-03-14 23:17:19', '2017-03-16 23:17:20', '小和山', '100', '2017-03-14 23:17:28', '2017-05-15 23:17:29', '浙江科技学院', '');
INSERT INTO `actives` VALUES ('41', '省级体育特色项目实践基地签约 ', '吕兵兵', '2017-03-15', '3月10日,学校省级体育特色项目实践基地落户白龙潭风景区,副校长冯军出席签约仪式并为实践教学基地授牌。\r\n《户外运动》作为省级体育特色项目，野外生存训练是该项目的的重要内容，每年都会带领学生在野外进行实践活动。为规范实践教学，深化体育俱乐部的改革，经实地考察、教学摸索，选定白龙潭风景区作为该项目的实践基地，突出俱乐部特色性，保障实践教学安全性。\r\n体育部负责人与白龙潭风景区总经理分别代表双方进行签约。双方明确在大学生野外生存生活训练实践活动中应尽的责任；此外，我校师生凭有效证件，在协议期内进入白龙潭风景区，门票由每人六十元降为每人十元。\r\n宣传部、教务处和体育部等部门负责人参加签约授牌仪式。', './Public/Uploads/2017-03-15/58c81ca4039b9.jpg', null, '2017-03-15 00:38:27', '2017-03-16 00:38:28', '小和山', '100', '2017-03-15 00:38:36', '2017-05-17 00:38:38', '浙江科技学院', '抓紧报名！  ');
INSERT INTO `actives` VALUES ('42', '校社科联举行第二届第二次理事（扩大）会 ', '吕兵兵', '2017-03-15', '1月10日，社科联举行第二届第二次理事（扩大）会，会议由校纪委书记、社科联副主席李泽泉主持。校党委委员、社科联副主席毛建卫参加会议。\r\n\r\n与会人员听取了社科联秘书长俞晓群对社科联近两年工作汇报，回顾了校社科联在推进人文社科智库和学术团队建设；强化培育和组织，收获高水平科研成果；积极开展社科普及；拓展资源渠道、加强机制保障等四个方面取得的成绩和存在的不足。\r\n\r\n会议表决通过了校社科联副主席、常务理事增补名单。\r\n\r\n校社科联主席王建华出席会议并讲话。他充分肯定了校社科联两年来的工作，分析了目前存在的问题，提出了未来校社科联的主要任务，一是抓好重点项目和平台的建设，争取高水平，高层次学术资源，做好人文社科类成果奖的申报工作；二是抓好社科普及工作，尤其要加强针对工科的普及。\r\n\r\n李泽泉分析了我校社科联的工作现状，肯定两年来我校人文社科类国家级课题，高水平论文、科研骨干培育等方面取得的成绩。他希望，校社科联要发挥优势和特色，进一步推动社科联工作发展。\r\n\r\n全体理事及人文社科类二级学院科研秘书、科研骨干参加会议。', './Public/Uploads/2017-03-15/58c81d6697309.jpg', null, '2017-03-15 00:41:54', '2017-03-17 00:41:54', '浙江科技学院', '10', '2017-03-15 00:42:06', '2017-05-16 00:42:07', '劲竹书院', '');
